import React from 'react'
import Component from './Component'
import { Main, MainGrid, Subgrid, SuperSubgrid } from './Counteranimation.element'
import { Data } from './Data'

function Counteranimation() {
    return (
        <Main>
            <MainGrid>
            <Subgrid>
            <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 209.76 209.76"><defs><style dangerouslySetInnerHTML={{__html: ".cls-1{fill:#83a9ff;}.cls-2{fill:#162082;}" }} /></defs><g id="Layer_2" data-name="Layer 2"><g id="Layer_1-2" data-name="Layer 1"><path className="cls-1" d="M209.76,104.88A104.88,104.88,0,1,1,23.67,38.51l.31-.16c2-1.1,7.14-4.27,9.69-2.42s1.3,7,.9,9A91.51,91.51,0,0,1,104.15,13h.26L104.54,0h.35A104.88,104.88,0,0,1,209.76,104.88Z" /><path className="cls-2" d="M203.3,104.7A99.21,99.21,0,1,1,104.09,5.49h.28A99.21,99.21,0,0,1,203.3,104.7Z" /></g></g></svg>
            </Subgrid>
            {Data.map((item,index)=>{
        return(  
        <>
          
        
        <SuperSubgrid>
                    <div>{item.state}</div>
                    <div>{item.customer}</div>
                    <div>{item.description}</div>
            </SuperSubgrid> </>)
            })}
           
            </MainGrid>
        </Main>
      
    )
}

export default Counteranimation
